import React, { useState } from "react";
function App() {
  const [state, setState] = useState({ count: 0, name: "React" });
  return (

    <div>
      <p>The count is {state.count}</p>
      <p>The name is {state.name}</p>
      <button onClick={() => setState({ ...state, count: state.count + 1 })}>
        Increment
      </button>
    </div>
  );
}
export default App;
